import React from 'react';
function Home(){
    return (
        <div className='row'>
            <div className='col-md-12 be_courageous'>
                <div className='main-header'>Be Courageous</div>
                <div className='divblock'></div>
                <p>Be strong and courageous, do not be terrified, do not be discouraged, for the Lord your God is with you where ever you go.</p>
                <p>Joshua 1.9</p>
                <p>Listen to the top Christian podcast, Bible teaching and sermons.</p>
            </div>
        </div>
    )
}
export default Home;
